import React from 'react';
import { 
  Heading,
  Paragraph,
  Card,
  Box,
  Tag,
  Link,
  Table
} from '@digdir/designsystemet-react';

interface SlackChannel {
  name: string;
  purpose: string;
  members: number;
  category: 'general' | 'help' | 'development' | 'design';
}

const channels: SlackChannel[] = [
  {
    name: 'designsystemet-general',
    purpose: 'General discussion about Designsystemet',
    members: 245,
    category: 'general'
  },
  {
    name: 'designsystemet-help',
    purpose: 'Get help with using Designsystemet components',
    members: 189,
    category: 'help'
  },
  {
    name: 'designsystemet-dev',
    purpose: 'Technical discussions and development updates',
    members: 156,
    category: 'development'
  },
  {
    name: 'designsystemet-design',
    purpose: 'Design discussions and updates',
    members: 134,
    category: 'design'
  }
];

const getCategoryColor = (category: SlackChannel['category']) => {
  switch (category) {
    case 'general':
      return 'neutral';
    case 'help':
      return 'success';
    case 'development':
      return 'info';
    case 'design':
      return 'warning';
    default:
      return 'neutral';
  }
};

const SlackChannels: React.FC = () => {
  return (
    <div>
      <Heading level={1} size="xlarge" spacing>Slack Channels</Heading>
      <Paragraph spacing>
        Join our Slack channels to connect with the Designsystemet community, get help,
        and stay updated on the latest developments.
      </Paragraph>

      <Card>
        <Box padding="4">
          <Table>
            <Table.Header>
              <Table.Row>
                <Table.HeaderCell>Channel</Table.HeaderCell>
                <Table.HeaderCell>Purpose</Table.HeaderCell>
                <Table.HeaderCell>Members</Table.HeaderCell>
                <Table.HeaderCell>Category</Table.HeaderCell>
              </Table.Row>
            </Table.Header>
            <Table.Body>
              {channels.map((channel) => (
                <Table.Row key={channel.name}>
                  <Table.Cell>
                    <Link href={`slack://channel?team=T0XXXXX&id=${channel.name}`}>
                      #{channel.name}
                    </Link>
                  </Table.Cell>
                  <Table.Cell>{channel.purpose}</Table.Cell>
                  <Table.Cell>{channel.members}</Table.Cell>
                  <Table.Cell>
                    <Tag
                      size="small"
                      color={getCategoryColor(channel.category)}
                    >
                      {channel.category}
                    </Tag>
                  </Table.Cell>
                </Table.Row>
              ))}
            </Table.Body>
          </Table>
        </Box>
      </Card>

      <Card style={{ marginTop: '2rem' }}>
        <Box padding="4">
          <Heading level={2} size="small" spacing>Channel Guidelines</Heading>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li style={{ marginBottom: '1rem' }}>
              <Tag color="neutral" size="small" style={{ marginRight: '0.5rem' }}>General</Tag>
              <Paragraph spacing={false}>For general discussions and announcements</Paragraph>
            </li>
            <li style={{ marginBottom: '1rem' }}>
              <Tag color="success" size="small" style={{ marginRight: '0.5rem' }}>Help</Tag>
              <Paragraph spacing={false}>Get assistance with implementation and usage</Paragraph>
            </li>
            <li style={{ marginBottom: '1rem' }}>
              <Tag color="info" size="small" style={{ marginRight: '0.5rem' }}>Development</Tag>
              <Paragraph spacing={false}>Technical discussions and code-related topics</Paragraph>
            </li>
            <li>
              <Tag color="warning" size="small" style={{ marginRight: '0.5rem' }}>Design</Tag>
              <Paragraph spacing={false}>Design-related discussions and feedback</Paragraph>
            </li>
          </ul>
        </Box>
      </Card>
    </div>
  );
};

export default SlackChannels;
